import Button from '../Components/Button.jsx'
import InputData from '../Components/InputData'
import styles from '../Style/App_module.css'
import { redirect } from 'react-router-dom';
import { useContext, useState } from 'react';
import { AuthContext } from '../providers/AuthProvider';
import React from  'react';



 function Registrate() {
  const red = () => {
    redirect('/login');
  }
  const {user,setUser}=useContext(AuthContext)
  const [inputMail, setInputMail] = useState('');
  const [inputLogin, setInputLogin] = useState('');
  const [inputPassword, setInputPassword] = useState('');

  function addData() {

    let newData = {
        Mail: inputMail,
        Login: inputLogin,
        Password: inputPassword
    };}

  return (
    <div >
      <main>
        <h1 align="center">Registrate
        <br/>
            <input value={inputMail} 
            title="Mail" 
            onChange={(event) => setInputMail(event.target.value)}>
            </input>
            <br/>
            <input value={inputLogin} 
            title="Login" 
            onChange={(event) => setInputLogin(event.target.value)}>
            </input>
            <br/>
            <input value={inputPassword} 
            title="Password" 
            onChange={(event) => setInputPassword(event.target.value)}>
            </input>
            <br/>
            <button onClick={red}>
              Registrate
            </button>
        </h1>
      </main>
    </div>
  )
}
export default Registrate
